import "bootstrap/dist/css/bootstrap.min.css";
import './App.css';
import React, { useEffect, useRef } from "react";
import Navbar from './components/layouts/Navbar';
import Registration from "./components/pages/Registration";
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Home from "./components/pages/Home";
import SitterList from "./components/pages/SitterList";
import SearchSitter from "./components/pages/SearchSitter";

const  App = () => {

  const effectRan = useRef(false);
  useEffect(() => {
    if (effectRan.current === false) {
      const script = document.createElement("script");
      script.src ="https://maps.googleapis.com/maps/api/js?key=AIzaSyAfL2oULbnrWbl_G-WdVcxGH8TfEme8dhk&libraries=places&callback=initMap";
      script.async = true;
      document.body.appendChild(script);
      return () => {
        document.body.removeChild(script);
        effectRan.current = true;
      };
    }
  }, []);
  window.initMap = initMap;
  return (
    <div className="App">
    <Router>
        <Navbar />
        <Routes>
            <Route exact path="/" element={<Home />} />  
            <Route exact path="/register" element={<Registration />} />
            <Route exact path="/search" element={< SearchSitter />} />
            <Route exact path="/admin/sitterlist" element={<SitterList />} />
        </Routes>

    </Router>
    </div>
  );
}

export default App;
